import Link from "next/link";

const Landing = () => (
  <div className="landing">
    <section id="intro">
      <h1>WOO YOUNG CHOI</h1>
      <p>
        <span>UI/UX designer</span> & <span>front-end developer</span> based in
        New York, NY.
      </p>
    </section>
    <style jsx>
      {`
        .landing {
          align-items: center;
          display: flex;
          flex-direction: column;
          font-family: Futura;
          justify-content: center;
          min-height: 100vh;
          text-align: center;
        }
        h1 {
          font-family: Futura;
          font-size: 70px;
          font-weight: 600;
          text-shadow: 15px 15px #d9d9d9;
        }
        p {
          font-family: Montserrat;
          font-size: 16px;
          font-weight: 100;
        }
        span {
          font-size: 23px;
          font-weight: 500;
          letter-spacing: 3px;
        }
      `}
    </style>
  </div>
);

export default Landing;
